import './App.css';
import { Message } from './components/Message'

const message_prop = 'I m a prop';

function App() {
  const handleClick = () => {
    alert('click me')
  }
  return (
    <div className="App">
      <header className="App-header">
        <Message message={ message_prop} message2 = "Props are very happy" onClick={handleClick}/>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
